        'https://via.placeholder.com/300x200/FFD700/000000?text=T-Shirt+1',
        'https://via.placeholder.com/300x200/98FB98/000000?text=T-Shirt+2',
      ],
      availability: {
        '2024-12-22': ['8:00 AM', '12:00 PM', '4:00 PM'],
        '2024-12-23': ['9:00 AM', '11:00 AM'],
      },
    },
    {
