      location: 'Jaipur',
      profilePicture: 'https://via.placeholder.com/150',
      portfolio: [
        'https://via.placeholder.com/300x200/FFD700/000000?text=Henna+1',
        'https://via.placeholder.com/300x200/98FB98/000000?text=Henna+2',
      ],
      availability: {
        '2024-12-22': ['8:00 AM', '10:00 AM', '5:00 PM'],
        '2024-12-23': ['9:00 AM', '11:00 AM', '3:00 PM'],
      },
    },
    {
      id: 10,
      name: 'Mia White',
      skills: ['Handmade Crafts', 'Home Decor'],
      location: 'Surat',
      profilePicture: 'https://via.placeholder.com/150',
      portfolio: [
        'https://via.placeholder.com/300x200/FFB6C1/000000?text=Craft+1',
        'https://via.placeholder.com/300x200/ADD8E6/000000?text=Craft+2',
      ],
      availability: {
        '2024-12-22': ['10:00 AM', '12:00 PM', '2:00 PM'],
        '2024-12-23': ['11:00 AM', '3:00 PM'],
      },
    },
  ];

  useEffect(() => {
    const selectedArtist = artistData.find((item) => item.id === parseInt(id));
    setArtist(selectedArtist);

    if (selectedArtist) {
      const dateStr = selectedDate.toISOString().split('T')[0];
      setTimeSlots(selectedArtist.availability[dateStr] || []);
    }
  }, [id, selectedDate]);

  const handleDateChange = (date) => {
    setSelectedDate(date);

    if (artist) {
      const dateStr = date.toISOString().split('T')[0];
      setTimeSlots(artist.availability[dateStr] || []);
    }
  };

  if (!artist) {
    return (
      <div style={{ textAlign: 'center', marginTop: '50px' }}>
        <h2>Artist Not Found</h2>
      </div>
    );
  }

  return (
    <>
      <Navbar />
      <div className="portfolio-container">
        <h2>{artist.name}'s Portfolio</h2>
        <Calendar onChange={handleDateChange} value={selectedDate} />
        <h3>Time Slots</h3>
        <div>
          {timeSlots.length > 0
            ? timeSlots.map((slot, index) => <p key={index}>{slot}</p>)
            : 'No available slots'}
        </div>
      </div>
      <Footer />
    </>
  );
};

export default Portfolio;
